@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

/* (:: Camino Toolbar Icons ::) - NORMAL icon size ONLY */

/* Position Tweaks */
#nav-bar {padding-bottom: 7px !important; padding-top: 2px !important;}
#back-button {padding-right: 8px !important;}
#forward-button,
#reload-button,
#stop-button,
#home-button,
#print-button,
#downloads-button,
#history-button,
#bookmarks-button,
#new-tab-button {padding-right: 2px !important;}
#back-forward-dropmarker {display:none !important;}

/* Buttons: normal */
#back-button {-moz-image-region: rect(0px 31px 31px 0px) !important;}
#forward-button {-moz-image-region: rect(0px 63px 31px 32px) !important;}
#reload-button {-moz-image-region: rect(0px 95px 31px 64px) !important;}
#stop-button {-moz-image-region: rect(0px 127px 31px 96px) !important;}
#home-button {-moz-image-region: rect(0px 159px 31px 128px) !important;}
#print-button {-moz-image-region: rect(0px 191px 31px 160px) !important;}
#downloads-button {-moz-image-region: rect(0px 223px 31px 192px) !important;}
#history-button {-moz-image-region: rect(0px 255px 31px 224px) !important;}
#bookmarks-button {-moz-image-region: rect(0px 287px 31px 256px) !important;}
#new-tab-button {-moz-image-region: rect(0px 320px 31px 288px) !important;}

/* Buttons: disabled */
#back-button[disabled="true"] {-moz-image-region: rect(32px 31px 63px 0px) !important;}
#forward-button[disabled="true"] {-moz-image-region: rect(32px 63px 63px 32px) !important;}
#reload-button[disabled="true"] {-moz-image-region: rect(32px 95px 63px 64px) !important;}
#stop-button[disabled="true"] {-moz-image-region: rect(32px 127px 63px 96px) !important;}

/* Buttons: active */
#back-button:not([disabled="true"]):active {-moz-image-region: rect(64px 31px 95px 0px) !important;}
#forward-button:not([disabled="true"]):active {-moz-image-region: rect(64px 63px 95px 32px) !important;}
#reload-button:not([disabled="true"]):active {-moz-image-region: rect(64px 95px 95px 64px) !important;}
#stop-button:not([disabled="true"]):active {-moz-image-region: rect(64px 127px 95px 96px) !important;}
#home-button:not([disabled="true"]):active {-moz-image-region: rect(64px 159px 95px 128px) !important;}
#print-button:not([disabled="true"]):active {-moz-image-region: rect(64px 191px 95px 160px) !important;}
#downloads-button:not([disabled="true"]):active {-moz-image-region: rect(64px 223px 95px 192px) !important;}
#history-button:not([disabled="true"]):active {-moz-image-region: rect(64px 255px 95px 224px) !important;}
#bookmarks-button:not([disabled="true"]):active {-moz-image-region: rect(64px 287px 95px 256px) !important;}
#new-tab-button:active:not([disabled="true"]):active {-moz-image-region: rect(64px 320px 95px 288px) !important;}

/* Base64 Image */
#back-button,
#forward-button,
#reload-button,
#stop-button,
#home-button,
#print-button,
#downloads-button,
#history-button,
#bookmarks-button,
#new-tab-button {
list-style-image: url("data:image/png;base64,") 
!important;}

